    false,nt"url": null,nt"notes": "The U.S. Department of Agriculture, Animal
    and Plant Health Inspection Service, Wildlife Services (WS) and the U.S. Fish and
    Wildlife Service (USFWS) initiated and funded a nationwide avian influenza surveillance
    project for the early detection of HP-H5N1 in 2006, which continued annually through
    2010. The surveillance included all four flyways, all states, and tribal lands in
    the United States. Montana was considered a top priority state because the Pacific
    and Central Flyways divide the state and it borders Canada. Montana Fish, Wildlife
    and Parks (FWP), WS, and USFWS conducted sample collections for the 2010 Montana
    AI surveillance project. The Montana Department of Livestock Diagnostic Laboratory
    (MDoL), National Veterinary Services Laboratory (NVSL), and the U.S. Geological
    Survey National Wildlife Health Center (NWHC) tested samples. The Tribal Nations
    and the Department of Public Health and Human Services were also collaborators.
    The objective of the project was to employ multiple sampling strategies to maximize
    the chance of detecting HP-H5N1, including sampling live and hunter-harvested waterfowl,
    conducting state-wide systematic mortality/morbidity transects, and collecting samples
    from wild bird mortality/morbidity events.",nt"license_title": "License Not
